  \"sis-species-and-stock-administrative-data-set\",\n\t\"isopen\": false,\n\t\"url\":
  null,\n\t\"notes\": \"The Species and Stock Administrative data set within the Species
  Information System (SIS) defines entities within the database that serve as the
  basis for recording information in the other datasets (e.g. Fish Assessment, Status
  Determination, and Annual Catch Limits).  The data set  includes information such
  as  species and stock names, distribution and stock areas, as well as administrative
  information defining relationships amongst entities within the database.   \",\n\t\"license_title\":
